svg.script:
const mouth1 = document.getElementById("Mouth-1");
const mouth2 = document.getElementById("Mouth-2");
const avatar = document.getElementById("Avatar");
avatar.addEventListener("mouseover", (event) => {
  mouth1.style.display = 'none';
  mouth2.style.display = 'block';
});
avatar.addEventListener("mouseout", (event) => {
  mouth1.style.display = 'block';
  mouth2.style.display = 'none';
});
